import React from 'react';
import img1 from "../assets/images/visual arts/IMG_1571.png";
import img2 from "../assets/images/visual arts/bfd7990c-d3ce-4e99-a22d-e9de80acffbc.png";
import img3 from "../assets/images/visual arts/ac88487d-bdd5-4d1c-8511-7d1ad685a675.png";
import img4 from "../assets/images/visual arts/f96c68b5-562b-49ee-affa-b1ed4a9e8956.png";
import img5 from "../assets/images/visual arts/330ef35e-28b4-42ad-9030-b016361255f0.png";
import img6 from "../assets/images/visual arts/c1fe1ffa-0fa9-4e96-8c81-447856744cea.png";
import img7 from "../assets/images/visual arts/3c708007-7470-4bbe-8f04-42c95c90298f.png";
import img8 from "../assets/images/visual arts/d3c3b7f3-1726-4322-8037-15a3b804c7a2.png";
import img9 from "../assets/images/visual arts/55d51237-acb9-460d-8341-b8ce7f69915f.png";
import img10 from "../assets/images/visual arts/313b6a03-228f-49e4-a053-035c747dff0c.png";
import img11 from "../assets/images/visual arts/9b15f549-0975-4564-a0a3-efc32f9cd631.png";
import img12 from "../assets/images/visual arts/65d40626-ca68-4030-9345-3ebd41facfa3.png";
import img13 from "../assets/images/visual arts/a9a3a4b2-90b3-46a9-9faa-04dd8dd15aae.png";
import img14 from "../assets/images/visual arts/4473c63b-2aee-4123-b72a-cb7451566701.png";
import img15 from "../assets/images/visual arts/bd54df82-d593-4aa8-ad39-148b41dc39df.png";

import Footer from "../components/Footer.js";


import '../assets/css/visual-arts.css';

const VisualArts = () => (
    <>
        <div>
            <h1 class = "visual-arts">VISUAL ARTS</h1>
        </div>

        <section id = "center">
            <div class = "images">
                <img class = "row1" src = {img1}/>
                <img class = "row1" src = {img2}/>
                <img class = "row1" src = {img3}/>



                <img class = "row2" src = {img4}/>
                <img class = "row2" src = {img5}/>    

                <img class = "row3" src = {img6}/>
                <img class = "row3" src = {img7}/>    

                <img class = "row4" src = {img8}/>
                <img class = "row4" src = {img9}/>    

                <img class = "row5" src = {img10}/>
                <img class = "row5" src = {img11}/>
                <img class = "row5" src = {img12}/>    

                <img class = "row6" src = {img13}/>
                <img class = "row6" src = {img14}/>
                <img class = "row6" src = {img15}/>

                </div>
            </section>

        <div id = "foot">
            <Footer/> 
        </div>

    </>
);

export default VisualArts;
